      {!loading &&
        !error && */}
      {featuredTour.map((tour) => (
        <Col lg="3" className="mb-4" key={tour._id}>
          <TourCard tour={tour} />
        </Col>
      ))}
    </>
  );
};
export default FeatureTourList;
